import React from 'react';
import './App.css';
import Card from './Components/Card';

function App() {
  const parks = [
    { parkName: "Central Park", location: "New York City, New York", availibility: "Court 1: Open" },
    { parkName: "Golden Gate Park", location: "San Francisco, California", availibility: "Court 2: Closed" },
    { parkName: "Hyde Park", location: "London, UK", availibility: "Court 3: Open" },
    // Add more parks as needed
  ];

  return (
    <div className="card-container">
      {parks.map((park, index) => (
        <Card
          key={index}
          parkName={park.parkName}
          location={park.location}
          availibility={park.availibility}
        />
      ))}
    </div>
  );
}

export default App;
